import React, { Component } from "react";
import './body.css'
import {Form,Col} from 'react-bootstrap';

class Body extends Component
{
    constructor(props)
    {

        super(props);

        this.state = {
            name: '',
            password: '',
        };

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
        this.setState({
            [event.target.name]: event.target.value
        });
    }

    handleSubmit(event) {
        console.log( JSON.stringify(this.state));
        event.preventDefault();
    }

    render()
    {
        return(
            <div className="page-holder bg-cover">

                <div className="container py-5 ">
                    <header className="text-center text-grey py-5 animate__animated animate__fadeInUpBig ">
                        <h4 className="display-4 font-weight-bold mb-4">Wallet As A Service</h4>
                    </header>

                    <div className="bg_grey" style={{boxShadow:' 10px -10px  rgba(0,0,0,0.6);', mozBoxShadow:' 10px -10px  rgba(0,0,0,0.6);',
                        borderRadius:'100px;'}}>
                                    Login
                        <br/>
                        <header className="text-center" >
                            <Form>
                                <Form.Row>
                                    <Col>
                                        <Form.Control placeholder="First name" />
                                    </Col>
                                    <Col>
                                        <Form.Control placeholder="Last name" />
                                    </Col>
                                </Form.Row>
                            </Form>
                            <Button className="btn btn-block green" variant="secondary" size="lg" >Login</Button>
                            <br/>
                            <p className="forgot-password text-right">
                                New User ? <a href="/register"> Register here</a>
                            </p>
                            </header>

                    </div>



                </div>

            </div>
        )
    }
}
export default Body;

